import Nav from '../components/Nav'
import Footer from '../components/Footer'

const About = () => {
    return (
        <div className="about">
            <Nav />
            <div>
                <div><img src="../src/components/img/about_story.webp"/></div>
                <div></div>
            </div>
            <Footer />
        </div>
    );
}

export default About;
